import React from 'react'

function Buttons({btnname}) {
    const btnstyle = (e) =>{
        let cls
        if(btnname === "Low"){
         cls = "yellow"
        }
       else if(btnname === "Normal"){
         cls = "green"
        }
       else if(btnname === "High"){
         cls = "red"
        }
       console.log(cls);
    }
  return (
    <button className={btnstyle}  >{btnname}</button>
  )
}

export default Buttons
